def get_csv_writer(f):
    return csv.writer(f, dialect='unix')

# generates data for Users table (User.csv) and Charities (Charities.csv)
def gen_users(num_users):
    #with open('Users.csv', 'w') as f:
    with open('Users.csv', 'w') as f, open('Charities.csv', 'w') as charities_file:

        writer = get_csv_writer(f)

# new:
        charities_writer = get_csv_writer(charities_file)

        curr_charity_id = 1

        print('Users...', end=' ', flush=True)
        for uid in range(num_users):
            if uid % 10 == 0:
                print(f'{uid}', end=' ', flush=True)
            profile = fake.profile()
            email = profile['mail']
            plain_password = f'pass{uid}'
            password = generate_password_hash(plain_password)
            name_components = profile['name'].split(' ')
            firstname = name_components[0]
            lastname = name_components[-1]
            balance = 0.0

            address = fake.text()

            writer.writerow([uid, email, password, firstname, lastname, balance, address])


            # Check if the user is a charity (every tenth user)
            if uid % 10 == 0:
                # Incremental ID for charity (different from user ID)
                charity_id = curr_charity_id
                curr_charity_id += 1

                charity_name = fake.text()

                description = fake.text()
                charities_writer.writerow([charity_id, uid, charity_name, email, password, description])

        print(f'{num_users} generated')
    return

# generates data for Bids table (Bids.csv)
def gen_bids(num_products):
    n_users = 0 
    available_pids = []
    with open('Bids.csv', 'w') as f:
        writer = get_csv_writer(f)
        print('Bids...', end=' ', flush=True)
        for pid in range(num_products):
            if pid % 100 == 0:
                print(f'{pid}', end=' ', flush=True)
                print(f'{n_users}', end=' ', flush=True)
                n_users += 1
            price = f'{str(fake.random_int(max=500))}.{fake.random_int(max=99):02}'
            writer.writerow([pid, 0, pid, price])
        print(f'{num_products} generated;')
    return available_pids



def gen_products(num_products, available_user_ids):
    #available_pids = []
    available_pids = set()
    #with open('Products.csv', 'w') as f:
    with open('Products.csv', 'w') as f, open('Sells.csv', 'w') as sells_file:
        writer = get_csv_writer(f)

        # NEW:
        sells_writer = get_csv_writer(sells_file)

        #print('Products...', end=' ', flush=True)
        print('Products and Sells...', end=' ', flush=True)


        #FIRST: Generate all of the products
        for pid in range(num_products):
            if pid % 100 == 0:
                print(f'{pid}', end=' ', flush=True)
            name = fake.sentence(nb_words=4)[:-1]
            #price = f'{str(fake.random_int(max=500))}.{fake.random_int(max=99):02}'
            starting_bid = f'{str(fake.random_int(max=500))}.{fake.random_int(max=99):02}'
            buy_now = f'{str(fake.random_int(max=500))}.{fake.random_int(max=99):02}'
            

            available = fake.random_element(elements=('true', 'false'))
            catergory = fake.random_element(elements=('food&drink', 'art&decor', 'electronics'))
            image = fake.random_element(elements=(images))
            expirytime = fake.future_datetime(end_date='+365d')
            rating = f'{str(fake.random_int(min=1, max=4))}.{fake.random_int(min=0, max=99):02}'
            if available == 'true':
                #available_pids.append(pid)
                available_pids.add(pid)

                # NEW:
                # Randomly select a charity for the product
                charity_id = fake.random_element(elements=available_user_ids)

                # Write the charity-product association to Sells.csv
                sells_writer.writerow([charity_id, pid])

            #writer.writerow([pid, name, price, available, catergory, expirytime, image, rating])
            writer.writerow([pid, name, starting_bid, buy_now, available, catergory, expirytime, image, rating])

        print(f'{num_products} generated; {len(available_pids)} available')
    return available_pids


# generates data for Products, Sells, and Orders table ==> connects these generated data components together.
def gen_products_purchases_orders(num_products, available_user_ids, num_purchases):
    #available_pids = []
    available_pids = set()

    unavailable_pids = set()
    
    #with open('Products.csv', 'w') as f:
    with open('Products.csv', 'w') as f, open('Sells.csv', 'w') as sells_file, open('Purchases.csv', 'w') as purchases_file, open('Orders.csv', 'w') as orders_file:
        writer = get_csv_writer(f)
        sells_writer = get_csv_writer(sells_file)

        purchases_writer = get_csv_writer(purchases_file)
        orders_writer =  get_csv_writer(orders_file)

        #print('Products...', end=' ', flush=True)
        print('Products and Sells...', end=' ', flush=True)


        #FIRST: Generate all of the products
        pid_pname_dict = dict()
        pid_cost_dict = dict()
        pid_sellerId_dict = dict()

        for pid in range(num_products):
            if pid % 100 == 0:
                print(f'{pid}', end=' ', flush=True)
            name = fake.sentence(nb_words=4)[:-1]
            #price = f'{str(fake.random_int(max=500))}.{fake.random_int(max=99):02}'
            starting_bid = f'{str(fake.random_int(max=500))}.{fake.random_int(max=99):02}'
            buy_now = f'{str(fake.random_int(max=500))}.{fake.random_int(max=99):02}'
            

            available = fake.random_element(elements=('true', 'false'))
            catergory = fake.random_element(elements=('food&drink', 'art&decor', 'electronics'))
            image = fake.random_element(elements=(images))
            expirytime = fake.future_datetime(end_date='+365d')
            rating = f'{str(fake.random_int(min=1, max=4))}.{fake.random_int(min=0, max=99):02}'
            if available == 'true':
                #available_pids.append(pid)
                available_pids.add(pid) # add each "available" product to set available_pids

                # NEW:
                # Randomly select a charity for the product
                charity_id = fake.random_element(elements=available_user_ids)

                # Write the charity-product association to Sells.csv
                sells_writer.writerow([charity_id, pid])

                #charity_id = fake.random_element(elements=available_user_ids)
                #pid_sellerId_dict[pid] = charity_id
                #pid_sellerId_dict[pid] = charity_id
            else: # if product is NOT available (available == false)
                unavailable_pids.add(pid)

                pid_sellerId_dict[pid] = fake.random_element(elements=available_user_ids)

                pid_pname_dict[pid] = name
                pid_cost_dict[pid] = buy_now

            #writer.writerow([pid, name, price, available, catergory, expirytime, image, rating])
            writer.writerow([pid, name, starting_bid, buy_now, available, catergory, expirytime, image, rating])

        print(f'{num_products} generated; {len(available_pids)} available')

        # Iterate through available_pids, create new set of UNAVAILABLE pids
            


        #SECOND: Generate Purchases (need to generate from Products s.t. available == false)
        #with open('Purchases.csv', 'w') as purchases_file:
        print('Purchases and Orders...', end=' ', flush=True)

        #for id in range(num_purchases):
        num_purchases = len(unavailable_pids)
        id = 0
        #for id in range(len(unavailable_pids)):
        while unavailable_pids: # while there are still products marked unavailable that have NOT yet been added to Purchases.csv
            if id % 100 == 0:
                print(f'{id}', end=' ', flush=True)
            uid = fake.random_int(min=0, max=num_users-1)
            pid = fake.random_element(elements=unavailable_pids)
            time_purchased = fake.date_time()
            purchases_writer.writerow([id, uid, pid, time_purchased])

            #THIRD: Generate Orders (needs to align with Purchases)
            name = pid_pname_dict[pid]
            total_cost = pid_cost_dict[pid]
            seller_id = pid_sellerId_dict[pid]

            orders_writer.writerow([id, id, name, uid, seller_id, time_purchased, total_cost, 'false'])

            # need to remove the recently added pid from unavailable_pids (from the set of pids of purchased products) ==> if a product is UNAVAILABLE, then it MUST be included in Puraches
            unavailable_pids.remove(pid)
            id += 1
            
        print(f'{num_purchases} generated')



    return available_pids



